secondaryOutcomes.description:
Safety analyses included listings and/or summaries of the following:

1. CTCAE for laboratory and non-laboratory parameters possibly related to study drug;
2. CTCAE Grades 3 and 4 for laboratory and non-laboratory parameters possibly related to study drug (Grade 3 - severe or medically significant but not immediately life-threatening; hospitalization or prolongation of hospitalization indicated; disabling; limiting self care. Grade 4 - life-threatening consequences; urgent intervention indicated);
3. Dose adjustments due to adverse events (AEs).

